import React, {Component} from 'react';
import MiniCount from "./Mini_count";

class Counter extends Component {
    render() {
        return (
            <div className="container" >
                <div id="counter" className="row text-center">
                    <MiniCount count_icon="fas fa-laptop-code" count_values={189} title_count="Dự Án"/>
                    <MiniCount count_icon="fas fa-user-tie" count_values={125} title_count="Khách Hàng"/>
                    <MiniCount count_icon="fas fa-briefcase" count_values={30} title_count="Đối Tác"/>
                    <MiniCount count_icon="fas fa-users" count_values={68} title_count="Nhân Viên"/>
                </div>
            </div>
        );
    }
}

export default Counter;
